import Link from "next/link";
import React, { useState } from "react";

export default function Home() {
    const [content, setContent] = useState([]);

    const categories = [
        { slug: "cams-bike", name: "Cam's Bike" },
        { slug: "container-gardening", name: "Container Gardening" },
        { slug: "data-backups", name: "Backing up data" },
        { slug: "homebrewing", name: "Homebrewing" },
        { slug: "italian-cooking", name: "Italian Cooking" },
        { slug: "lego-projects", name: "Lego Projects" },
        { slug: "lindsays-ollie", name: "Lindsay's Ollie" },
        { slug: "train-build", name: "Family Train Build" }
    ];

    return (
        <div>
            {content.map(content => content)}
            <div className="container mx-auto text-center">
                <h1 className="text-xl">Active personal and family projects</h1>
                <ul>
                    {categories.map(category => (
                        <a href={"/project/" + category.slug}>
                            <li className="cursor-pointer hover:font-light">
                                {category.name}
                            </li>
                        </a>
                    ))}
                </ul>
            </div>
        </div>
    );
}
